INSERT INTO `answer` (`seq`, `crdt`, `id`, `choice`, `object`, `created`, `model`, `usage_prompt_tokens`, `usage_completion_tokens`, `usage_total_tokens`) VALUES
	(1, '20230215', 'cmpl-6k5wKLgSLxBNb48ZVycyuGFdKH8HH', '1. 테이블 전체 삭제\n\nTRUNCATE TABLE 테이블명;\n\n2. ALTER TABLE 명령어를 사용하여 auto_increment 초기화\n\nALTER TABLE 테이블명 AUTO_INCREMENT = 1;', NULL, NULL, NULL, NULL, NULL, NULL),
	(2, '20230215', 'cmpl-6k5wx3WmYovT0kjyZQTH5cBl1hz9J', '### 1. mysql 서버 실행\n\n`$ mysqld`\n\n- mysql 서버를 실행하는 명령어로, 이 명령어를 실행하면 mysql 서버가 실행됩니다.\n\n### 2. mysql 서버 종료\n\n`$ mysqladmin -u root -p shutdown`\n\n- mysql 서버를 종료하는 명령어로, 이 명령어를 실행하면 mysql 서버가 종료됩니다.\n\n### 3. mysql 사용자 생성\n\n`$ mysql -u root -p -e "CREATE USER \'username\'@\'localhost\' IDENTIFIED BY \'password\';"`\n\n- mysql 사용자를 생성하는 명령어로, 이 명령어를 실행하면 사용자가 생성됩니다.\n\n### 4. mysql 데이터베이스 생성\n\n`$ mysql -u root -p -e "CREATE DATABASE dbname;"`\n\n- mysql 데이터베이스를 생성하는 명령어로, 이 명령어를 실행하면 데이터베이스가 생성됩니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(3, '20230215', 'cmpl-6k5xeEFDqCPNS4uS2dgRGH2eAe49U', '### 1. select\n\n```python\nimport pymysql\n\n# DB 연결\nconn = pymysql.connect(host=\'localhost\', user=\'root\', password=\'1234\', db=\'test\', charset=\'utf8\')\n\n# Connection 으로부터 Cursor 생성\ncurs = conn.cursor()\n\n# SQL문 실행\nsql = "select * from user"\ncurs.execute(sql)\n\n# 데이타 Fetch\nrows = curs.fetchall()\nfor row in rows:\n    print(row)\n\n# Connection 닫기\nconn.close()\n```\n\n### 2. insert\n\n```python\nimport pymysql\n\n# DB 연결\nconn = pymysql.connect(host=\'localhost\', user=\'root\', password=\'1234\', db=\'test\', charset=\'utf8\')\n\n# Connection 으로부터 Cursor 생성\ncurs = conn.cursor()\n\n# SQL문 실행\nsql = "insert into user (name, age) values (\'홍길동\', 20)"\ncurs.execute(sql)\n\n# Connection 닫기\nconn.close()\n```\n\n### 3. update\n\n```python\nimport pymysql\n\n# DB 연결\nconn = pymysql.connect(host=\'localhost\', user=\'root\', password=\'1234\', db=\'test\', charset=\'utf8\')\n\n# Connection 으로부터 Cursor 생성\ncurs = conn.cursor()\n\n# SQL문 실행\nsql = "update user set age=30 where name=\'홍길동\'"\ncurs.execute(sql)\n\n# Connection 닫기\nconn.close()\n```\n\n### 4. delete\n\n```python\nimport pymysql\n\n# DB 연결\nconn = pymysql.connect(host=\'localhost\', user=\'root\', password=\'1234\', db=\'test\', charset=\'utf8\')\n\n# Connection 으로부터 Cursor 생성\ncurs = conn.cursor()\n\n# SQL문 실행\nsql = "delete from user where name=\'홍길동\'"\ncurs.execute(sql)\n\n# Connection 닫기\nconn.close()\n```', NULL, NULL, NULL, NULL, NULL, NULL),
	(4, '20230215', 'cmpl-6k5yi7IFZQWE1R33LvOrwuJWaxpUc', '# FastAPI를 사용한 웹 서비스 구축 과정\n\n## 1. 프로젝트 준비\n\n- 프로젝트 폴더 생성\n- 가상환경 생성\n- 필요한 패키지 설치\n\n## 2. FastAPI 설정\n\n- FastAPI 설치\n- 앱 생성\n- 라우팅 설정\n\n## 3. 데이터베이스 연동\n\n- 데이터베이스 연결\n- 모델 생성\n- 데이터베이스 마이그레이션\n\n## 4. API 작성\n\n- API 작성\n- API 문서화\n\n## 5. 테스트\n\n- 단위 테스트 작성\n- 인터그레이션 테스트 작성\n\n## 6. 배포\n\n- 배포 스크립트 작성\n- 배포 서버 설정\n- 배포', NULL, NULL, NULL, NULL, NULL, NULL),
	(5, '20230215', 'cmpl-6k601fvfzQ86qtm3L7uUL5Gie7ReA', '# Ubuntu 에서 FastAPI 서비스 등록하기\n\nFastAPI 는 Python 을 사용하여 빠르고 강력한 API 를 만들 수 있는 프레임워크입니다. 이 가이드는 Ubuntu 에서 FastAPI 를 서비스로 등록하는 방법을 설명합니다.\n\n## 필요한 것\n\n- Ubuntu 서버\n- Python 3.6 이상\n- FastAPI 애플리케이션\n\n## 준비하기\n\n1. Ubuntu 서버에 Python 3.6 이상을 설치합니다.\n2. FastAPI 애플리케이션을 설치합니다.\n3. 애플리케이션을 실행할 수 있는 스크립트를 작성합니다.\n\n## 스크립트 작성하기\n\n스크립트는 애플리케이션을 실행하고 종료하는 데 사용됩니다. 스크립트는 다음과 같이 작성합니다.\n\n```bash\n#!/bin/bash\n\n# 애플리케이션의 경로\nAPP_PATH=/path/to/app\n\n# 애플리케이션을 실행합니다.\ncd $APP_PATH\npython3 app.py\n```\n\n## 스크립트 등록하기\n\n스크립트를 등록하기 위해 다음 명령을 실행합니다.\n\n```bash\nsudo cp script.sh /etc/init.d/fastapi\nsudo chmod +x /etc/init.d/fastapi\n```\n\n## 서비스 등록하기\n\n스크립트를 등록한 후 다음 명령을 실행하여 서비스를 등록합니다.\n\n```bash\nsudo update-rc.d fastapi defaults\n```\n\n## 서비스 실행하기\n\n서비스를 등록한 후 다음 명령을 실행하여 서비스를 실행합니다.\n\n```bash\nsudo service fastapi start\n```\n\n## 서비스 중지하기\n\n서비스를 중지하려면 다음 명령을 실행합니다.\n\n```bash\nsudo service fastapi stop\n```\n\n## 정리\n\n이 가이드는 Ubuntu 에서 FastAPI 를 서비스로 등록하는 방법을 설명합니다. 스크립트를 등록하고 서비스를 등록하면 서비스를 시작하고 중지할 수 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(6, '20230215', 'cmpl-6k6Jn8ZHMVHHAFqGzB4Flcr5c12qQ', '# Ubuntu 환경에서 FastAPI와 Gunicorn으로 서비스 등록하기\n\n## 필요한 것\n\n- Ubuntu 운영체제\n- Python 3.6 이상\n- FastAPI\n- Gunicorn\n\n## 준비하기\n\n1. Ubuntu 운영체제를 설치합니다.\n\n2. Python 3.6 이상을 설치합니다.\n\n3. FastAPI를 설치합니다.\n\n```\npip install fastapi\n```\n\n4. Gunicorn을 설치합니다.\n\n```\npip install gunicorn\n```\n\n## 서비스 등록하기\n\n1. FastAPI 앱을 작성합니다.\n\n2. Gunicorn을 사용하여 FastAPI 앱을 실행합니다.\n\n```\ngunicorn -w 4 -b 0.0.0.0:8000 app:app\n```\n\n3. 실행한 Gunicorn 프로세스를 시스템 서비스로 등록합니다.\n\n```\nsudo cp gunicorn.service /etc/systemd/system/\nsudo systemctl enable gunicorn.service\nsudo systemctl start gunicorn.service\n```\n\n4. 서비스가 정상적으로 동작하는지 확인합니다.\n\n```\nsudo systemctl status gunicorn.service\n```\n\n## 참고\n\n- [FastAPI Documentation](https://fastapi.tiangolo.com/)\n- [Gunicorn Documentation](http://docs.gunicorn.org/en/stable/)', NULL, NULL, NULL, NULL, NULL, NULL),
	(7, '20230215', 'cmpl-6k6M2IEl5EOhsZIWl9Rud4p0zy06W', '### XSS 보호하기\n\n1. **HTML 인코딩**: 특수 문자를 HTML 엔티티로 인코딩하는 것이 가장 좋은 방법입니다. 이는 사용자가 입력한 데이터를 브라우저가 인식할 수 없는 형태로 변환하는 것입니다.\n\n2. **스크립트 필터링**: 사용자가 입력한 데이터에서 스크립트 태그를 제거하는 것이 좋습니다. 이는 사용자가 입력한 데이터에서 스크립트 태그를 제거하는 것입니다.\n\n3. **입력 검증**: 사용자가 입력한 데이터가 올바른 형식인지 검증하는 것이 좋습니다. 이는 사용자가 입력한 데이터가 올바른 형식인지 검증하는 것입니다.\n\n4. **적절한 컨텐츠 정책**: 사용자가 입력할 수 있는 데이터를 제한하는 것이 좋습니다. 이는 사용자가 입력할 수 있는 데이터를 제한하는 것입니다.\n\n5. **CSP (Content Security Policy)**: 사용자가 입력한 데이터를 신뢰할 수 없는 소스에서 불러오지 못하도록 하는 것이 좋습니다. 이는 사용자가 입력한 데이터를 신뢰할 수 없는 소스에서 불러오지 못하도록 하는 것입니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(8, '20230215', 'cmpl-6k6OeNIBsa9Xz1YpwgvbcrIwWFZps', '```python\n# XSS 방지 코드\nimport cgi\n\ndef escape_html(s):\n    return cgi.escape(s, quote=True)\n\n# 사용 예\nprint(escape_html("<script>alert(\'XSS\')</script>"))\n# <script>alert(\'XSS\')</script>\n```', NULL, NULL, NULL, NULL, NULL, NULL),
	(9, '20230215', 'cmpl-6k6TLcjDGpOlJW0oXlzNs4t9PtTJ6', '```\n# 파이썬 파일 목록 가져오기\n\nimport os\n\n# 현재 디렉토리의 파일 목록 가져오기\nfiles = os.listdir(\'.\')\n\n# 파일 목록 출력\nfor file in files:\n    # 파일의 절대 경로 가져오기\n    file_path = os.path.abspath(file)\n    print(file_path)\n```', NULL, NULL, NULL, NULL, NULL, NULL),
	(10, '20230215', 'cmpl-6kA5AWsBEGe3aB24nDLTPdU59Plpc', '# 구글 애드센스 승인하기\n\n구글 애드센스는 웹 사이트에 광고를 통해 수익을 창출할 수 있는 가장 인기있는 방법 중 하나입니다. 승인을 받기 위해서는 다음과 같은 단계를 따라야 합니다.\n\n1. 구글 애드센스 계정을 만듭니다.\n2. 웹 사이트를 준비합니다.\n3. 웹 사이트에 광고 코드를 삽입합니다.\n4. 구글 애드센스 계정에 웹 사이트를 등록합니다.\n5. 구글 애드센스 계정을 승인하기 위해 인증서를 제출합니다.\n6. 구글 애드센스 계정이 승인되면 광고가 시작됩니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(11, '20230215', 'cmpl-6kAMDdZ76P75dV4JBnEDmJ5NyHlST', '**학습된 방법으로 스트레스를 줄이는 방법**\n\n1. 매일 적절한 운동을 하기: 운동은 스트레스를 줄이고 긍정적인 생각을 유발하는 데 도움이 됩니다.\n\n2. 적절한 수면 시간을 갖기: 적절한 수면 시간은 스트레스를 줄이고 신체와 마음을 회복하는 데 도움이 됩니다.\n\n3. 스트레스를 줄이는 심리적 기술을 사용하기: 스트레스를 줄이기 위해 심리적 기술을 사용하는 것이 좋습니다. 예를 들어, 마음을 다듬기, 명상, 자기 지도 등이 있습니다.\n\n4. 스트레스를 줄이는 생활 습관을 갖기: 스트레스를 줄이기 위해 생활 습관을 갖는 것이 좋습니다. 예를 들어, 음식을 적게 먹고, 적절한 식사를 하고, 적절한 수면 시간을 갖고, 적절한 운동을 하고, 적절한 시간을 갖고 쉬는 것 등이 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(12, '20230215', 'cmpl-6kAt7WLHGKS3xFKBpM4vu5rdmdETZ', '1. 인간의 일을 대신하는 기계가 인간의 일에 대한 인식이 없기 때문에 인간의 생각과 다른 결과를 내는 경우\n2. 인간의 일을 대신하는 기계가 인간의 일을 더 빠르게 수행하는 경우 인간의 일에 대한 수요가 줄어들고 인간의 일자리가 사라질 수 있음\n3. 인간의 일을 대신하는 기계가 인간의 일을 더 빠르게 수행하는 경우 인간의 일이 더 비싼 가격으로 구매될 수 있음\n4. 인간의 일을 대신하는 기계가 인간의 일을 더 빠르게 수행하는 경우 인간의 일이 더 낮은 품질로 제공될 수 있음\n5. 인간의 일을 대신하는 기계가 인간의 일을 더 빠르게 수행하는 경우 인간의 일이 더 빠르게 수행되지만 인간의 일이 제대로 수행되지 않을 수 있음\n6. 인간의 일을 대신하는 기계가 인간의 일을 더 빠르게 수행하는 경우 인간의 일이 더 빠르게 수행되지만 인간의 일이 제대로 수행되지 않아 인간의 생각과 다른 결과를 내는 경우가 발생할 수 있음\n7. 인간의 일을 대신하는 기계가 인간의 일을 더 빠르게 수행하는 경우 인간의 일이 더 빠르게 수행되지만 인간의 일이 제대로 수행되지 않아 인간의 생각과 다른 결과를 내는 경우가 발생하여 사회적 문제가 발생할 수 있음', NULL, NULL, NULL, NULL, NULL, NULL),
	(13, '20230216', 'cmpl-6kLjKt0hkgW42OgZptEArxqz4a8LP', '1. 윈도우 시작 버튼을 클릭합니다.\n2. `시작 메뉴`를 열고 `설정`을 클릭합니다.\n3. `앱` 메뉴를 열고 `기본 앱 설정`을 클릭합니다.\n4. `기본 웹 브라우져`를 클릭합니다.\n5. `Google Chrome`을 선택합니다.\n6. `적용` 버튼을 클릭합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(14, '20230216', 'cmpl-6kLkN7ag3GGA1tVc19ouN1vzXEYOu', '1. 윈도우 탐색기를 열고, `C:\\Users\\[사용자 이름]\\Anaconda3\\` 경로로 이동합니다.\n2. `jupyter_notebook_config.py` 파일을 열고, 다음과 같이 수정합니다.\n    ```\n    c.NotebookApp.browser = \'"C:/Program Files (x86)/Google/Chrome/Application/chrome.exe" %s\'\n    ```\n3. 수정한 파일을 저장하고, Jupyter notebook을 재실행합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
