	(16, '20230216', 'cmpl-6kM4gkFvYnvtj3dD3PZwss7Zywca9', '### matplotlib를 이용해 pandas 데이타를 차트로 표현하기\n\nmatplotlib은 파이썬에서 데이터를 차트로 그래프화하는 라이브러리이다. pandas 데이타를 이용해 matplotlib을 이용해 차트로 표현하는 방법을 알아보자.\n\n#### 1. 데이터 준비하기\n\n먼저 pandas 데이터를 준비해야 한다. 예를 들어 다음과 같은 데이터를 준비해보자.\n\n| 국가 | 인구 |\n|-----|------|\n| 한국 | 5200만 |\n| 일본 | 12700만 |\n| 중국 | 141000만 |\n\n이 데이터를 pandas 데이터프레임으로 만들어보자.\n\n```python\nimport pandas as pd\n\ndata = {\n    \'국가\': [\'한국\', \'일본\', \'중국\'],\n    \'인구\': [5200, 12700, 141000]\n}\n\ndf = pd.DataFrame(data)\n```\n\n#### 2. matplotlib로 그래프 그리기\n\nmatplotlib을 이용해 차트로 그래프를 그리기 위해서는 먼저 matplotlib 라이브러리를 불러와야 한다.\n\n```python\nimport matplotlib.pyplot as plt\n```\n\n그리고 데이터프레임의 데이터를 이용해 그래프를 그리기 위해 다음과 같이 그래프를 그릴 데이터를 준비한다.\n\n```python\nx = df[\'국가\']\ny = df[\'인구\']\n```\n\n그리고 다음과 같이 그래프를 그린다.\n\n```python\nplt.bar(x, y)\nplt.title(\'국가별 인구\')\nplt.xlabel(\'국가\')\nplt.ylabel(\'인구\')\nplt.show()\n```\n\n#### 3. 결과 확인하기\n\n그래프가 완성되면 다음과 같이 결과를 확인할 수 있다.\n\n![국가별 인구](./images/population.png)', NULL, NULL, NULL, NULL, NULL, NULL),
