	(19, '20230216', 'cmpl-6kR6OcXmj8EX0DLCNGkoiVFnrywKX', '선형대수학(Linear Algebra)은 벡터 공간과 그 상의 변환에 관한 수학의 한 분야로, 벡터 공간의 기하학적 구조를 분석하고 이를 이용하여 다양한 문제를 해결하는 데 사용됩니다. 선형대수학은 다차원 공간에서의 벡터, 행렬, 대각화, 역행렬, 고유값 및 고유벡터 등의 개념을 사용하여 다양한 문제를 해결하는 데 사용됩니다. 이러한 개념은 수학, 과학, 공학 및 컴퓨터 과학 분야에서 널리 사용됩니다.', NULL, NULL, NULL, NULL, NULL, NULL),
