	(53, '20230219', 'cmpl-6laI8VzvqkYiruk8ns70SyzLjvxDF', 'Flutter는 Google에서 개발한 오픈 소스 모바일 UI 프레임워크입니다. Flutter는 안드로이드, iOS 및 데스크톱 플랫폼에서 사용할 수 있는 빠르고 유연한 모바일 앱을 만들기 위해 사용됩니다. Flutter는 다양한 유형의 앱을 만들기 위해 사용할 수 있는 다양한 유연한 유틸리티를 제공합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
