	(96, '20230222', 'cmpl-6mR0SI3ybVIOvKBAnrw9TgihXfkKZ', '## crontab 스케쥴 등록 방법\n\ncrontab은 사용자가 지정한 시간에 자동으로 실행할 작업을 스케쥴링하는 방법입니다. crontab을 사용하면 사용자가 지정한 시간에 작업을 자동으로 실행할 수 있습니다.\n\ncrontab을 사용하기 위해서는 먼저 crontab 명령어를 사용하여 crontab 파일을 열어야 합니다. 다음 명령어를 사용하여 crontab 파일을 열 수 있습니다.\n\n```\n$ crontab -e\n```\n\ncrontab 파일이 열리면 사용자가 스케쥴링할 작업을 입력할 수 있습니다. crontab 파일의 각 필드는 다음과 같습니다.\n\n```\n* * * * * command to be executed\n│ │ │ │ │\n│ │ │ │ └───── day of week (0 - 6) (0 to 6 are Sunday to Saturday, or use names; 7 is Sunday, the same as 0)\n│ │ │ └────────── month (1 - 12)\n│ │ └─────────────── day of month (1 - 31)\n│ └──────────────────── hour (0 - 23)\n└───────────────────────── min (0 - 59)\n```\n\n예를 들어, 매일 오전 9시에 스크립트를 실행하려면 다음과 같이 입력합니다.\n\n```\n0 9 * * * /path/to/script.sh\n```\n\n입력이 완료되면 crontab 파일을 저장하고 나면 스케쥴링된 작업이 실행됩니다.', NULL, NULL, NULL, NULL, NULL, NULL),
