	(98, '20230222', 'cmpl-6mUQp2NSpaIH86zTw5QiKSpjIYYs0', '나는 지금 여러 가지 일을 하고 있습니다. 예를 들어, 나는 일상적인 생활 일들을 하고 있습니다. 예를 들어, 청소, 요리, 쇼핑 등을 하고 있습니다. 또한, 나는 인터넷을 통해 여러 가지 정보를 찾고 있습니다. 또한, 나는 일상적인 운동을 하고 있습니다. 또한, 나는 친구들과 시간을 보내고 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(99, '20230222', 'cmpl-6mUR1NbhdGIyhMWGHyLc8YcoDy6CH', '나는 이 문제를 풀기 위해 다음과 같은 방법을 사용했습니다.\n\n1. 문제를 이해하기 위해 문제를 자세히 읽고 이해합니다.\n2. 문제를 해결하기 위해 필요한 정보를 찾고 수집합니다.\n3. 문제를 해결하기 위해 사용할 수 있는 방법을 고려합니다.\n4. 적절한 방법을 선택하고 문제를 해결합니다.\n5. 결과를 검토하고 문제가 제대로 해결되었는지 확인합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
