	(136, '20230225', 'cmpl-6ncYXsRxKoDFJfkjfOiFmt0t470Z3', '요\n\n저는 더 나은 방법을 찾기 위해 노력하고 있습니다. 다른 방법을 찾기 위해 더 노력하겠습니다. 당신의 도움이 필요합니다. 감사합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(137, '20230225', 'cmpl-6nfQ7BjhWdVUYDtWfAVZvrsMWZAa6', '은 무엇인가요?\n\n발달장애에 있어 잘 때 머리를 때리는 증상이 있습니다. 이는 발달장애 아동이 스트레스를 받거나 불안할 때 발생하는 행동입니다. 이러한 행동을 줄이기 위해서는 아동의 스트레스를 줄이고 안정감을 주는 것이 중요합니다. 이를 위해 아동이 즐거운 활동을 하도록 지도하고, 아동이 스트레스를 받을 때 안정감을 주는 적절한 치료를 시행하는 것이 좋습니다. 또한, 아동이 머리를 때리는 행동을 할 때 안정감을 주는 적절한 치료를 시행하는 것도 좋습니다. 예를 들어, 아동이 머리를 때릴 때 안정감을 주는 적절한 치료로는 아동이 즐거운 음악을 들으면서 머리를 때리는 것, 아동이 즐거운 음악을 들으면서 머리를 만지는 것, 아동이 즐거운 음악을 들으면서 머리를 만지고 자기를 위한 작은 선물을 받는 것 등이 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(138, '20230226', 'cmpl-6o1JzoVjpb55T7ZQU1ihjjOmVIX5C', 'Korea has implemented a number of measures to address its low birth rate. These include providing financial incentives for couples to have children, such as tax breaks and subsidies for childcare. The government has also implemented a number of policies to make it easier for women to balance work and family life, such as increasing the number of childcare facilities and providing more flexible working hours. Additionally, the government has increased public awareness of the issue through campaigns and education programs. Finally, the government has also implemented measures to encourage immigration, such as providing language and job training for immigrants.\n\n한국은 저출산 문제를 해결하기 위해 많은 조치를 시행해 왔다. 여기에는 세금 감면과 육아 보조금과 같은 부부가 아이를 가질 수 있도록 재정적인 인센티브를 제공하는 것이 포함된다. 정부는 육아시설을 늘리고 근로시간을 탄력적으로 제공하는 등 여성이 일과 가정생활의 균형을 맞추기 쉽게 하기 위한 정책도 다수 시행했다. 게다가, 정부는 캠페인과 교육 프로그램을 통해 이 문제에 대한 대중의 인식을 높였습니다. 마지막으로, 정부는 또한 이민자들에게 언어와 직업 훈련을 제공하는 것과 같은 이민을 장려하기 위한 조치들을 시행했다.', NULL, NULL, NULL, NULL, NULL, NULL),
