	(141, '20230226', 'cmpl-6o991V0CYChbJOlNPR9L0SdQ2piyp', '파이썬은 인터프리터 언어로, 간결하고 쉽게 이해할 수 있는 문법을 가지고 있습니다. 또한 다양한 응용 분야에서 사용되는 강력한 프로그래밍 언어로 자바, C 등과 비교해도 뛰어난 성능을 보여줍니다.', NULL, NULL, NULL, NULL, NULL, NULL),
