	(161, '20230227', 'cmpl-6oDZkAOk4aAZMvossNMuodhxq9ZKY', 'Creatures are evolved, not created.', NULL, NULL, NULL, NULL, NULL, NULL),
	(162, '20230227', 'cmpl-6oDb5C0JqXhJZffMbsCxvHAyXtWEr', 'It is impossible to predict the future, but it is likely that China will continue to be a major economic and political power in the coming years. China has already become the world\'s second-largest economy and is projected to overtake the United States as the world\'s largest economy in the near future. China is also a major player in international affairs and is increasingly influential in global politics.', NULL, NULL, NULL, NULL, NULL, NULL),
	(163, '20230227', 'cmpl-6oDcIPeazsKXPZLxSMI70ig7WM3Ej', 'There are many jobs that can be satisfying in Korea, such as teaching, nursing, engineering, IT, and finance. Other popular jobs include marketing, hospitality, and customer service. Many people also find satisfaction in working in the creative industries, such as music, film, and design.', NULL, NULL, NULL, NULL, NULL, NULL),
	(164, '20230227', 'cmpl-6oDcmDcU0F9YFCsWHTmlA3WjbAmFz', 'There are many jobs in Japan that can be satisfying, depending on the individual\'s interests and skills. Some of the most popular and satisfying jobs in Japan include teaching English, working in the hospitality industry, working in the IT industry, working in the finance industry, working in the healthcare industry, working in the media industry, and working in the tourism industry.', NULL, NULL, NULL, NULL, NULL, NULL),
	(165, '20230227', 'cmpl-6oDdIH0WWIGO77nFM4PklYJKR3URF', 'There are many jobs that can be satisfying in the US, including teaching, nursing, social work, engineering, software development, and many more. Ultimately, the job that is most satisfying for you will depend on your interests, skills, and values.', NULL, NULL, NULL, NULL, NULL, NULL),
	(166, '20230227', 'cmpl-6oKV0rTnp3kLTIsRTQxjmZBdyph03', '1. 어벤져스: 엔드게임\n2. 조커\n3. 포드 V 페라리\n4. 스파이더맨: 파 프롬 홈\n5. 알라딘', NULL, NULL, NULL, NULL, NULL, NULL),
	(167, '20230227', 'cmpl-6oKVhBWiEMwNMD979skW3WPYpuzgn', '1. 엑시트 (2020년 2월 5일)\n2. 스파이더맨: 파 프롬 홈 (2020년 2월 6일)\n3. 바이스 (2020년 2월 12일)\n4. 알라딘 (2020년 2월 20일)\n5. 스타 이즈 본 (2020년 2월 27일)', NULL, NULL, NULL, NULL, NULL, NULL),
	(168, '20230227', 'cmpl-6oKWjlg0d54fmVMJJrchMPoVjFgga', '엑시트는 역사상 최고의 스트릿 댄서인 에이블이 자신의 인생을 바꾸기 위해 댄스 대회에 참가하는 과정을 담은 드라마 영화이다. 에이블은 자신의 인생을 바꾸기 위해 댄스 대회에 참가하기로 결심하고, 이를 위해 에이블의 친구들과 함께 댄스 팀을 결성한다. 그들은 에이블의 인생을 바꾸기 위해 노력하며, 에이블은 자신의 인생을 바꾸기 위해 댄스 대회에 참가하는 과정에서 많은 것을 배우고 성장한다. 결국 에이블과 그의 동료들은 댄스 대회에서 우승하고, 에이블은 자신의 인생을 바꾸기 위해 노력한 결과를 얻었다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(169, '20230227', 'cmpl-6oKYdxWT0XJEzQjsw8iyJRi96ty48', '2022년 대한민국 신생아 출산율은 아직 미정입니다. 한국의 신생아 출산율은 연도별로 다르게 변화하고 있습니다. 2020년 한국의 신생아 출산율은 1.05명이었습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(170, '20230227', 'cmpl-6oOmcVQFrrJmf47HkHhoRmr7FFvri', '온라인에서 다양한 강의를 찾아볼 수 있습니다. 예를 들어, Udemy, Coursera, edX 등의 강의를 찾아볼 수 있습니다. 또한, 오프라인에서도 다양한 강의를 찾아볼 수 있습니다. 대학교, 커뮤니티 센터, 인터넷 카페 등의 곳에서 스플러터 강의를 찾아볼 수 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(171, '20230227', 'cmpl-6oP4XeYsemXlVlv10UmWD7FGBwu5p', '펨썹은 자신의 생명을 지키기 위해 도망치려합니다. 펨썹은 자신이 사는 환경에서 위험한 상황에 놓이게 되면 도망치려고 합니다. 펨썹은 자신이 사는 환경에서 위험한 상황이 발생하면 빠르게 도망치려고 합니다. 펨썹은 자신이 사는 환경에서 위험한 상황이 발생하면 빠르게 도망치려고 합니다. 또한, 펨썹은 자신이 사는 환경에서 위험한 상황이 발생하면 빠르게 도망치려고 합니다. 그래서 펨썹은 자신의 생명을 지키기 위해 도망치려고 합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
