	(173, '20230228', 'cmpl-6oapJKPPTaMHJheJsdMONKbUQwLUX', '서\n\n제 1 조 (목적)\n\n이 심판청구서는 혼인 관계에 있는 본인과 배우자가 소유한 재산을 분할하기 위해 심판을 청구하기 위한 것입니다.\n\n제 2 조 (소송 제기)\n\n본인과 배우자는 소송을 제기하여 소송을 제기하고 재산을 분할하기 위해 심판을 청구합니다.\n\n제 3 조 (재산 분할)\n\n본인과 배우자는 소송을 제기하고 재산을 분할하기 위해 심판을 청구합니다. 재산은 다음과 같이 분할됩니다.\n\n1. 본인이 소유한 재산\n2. 배우자가 소유한 재산\n3. 공동 소유한 재산\n\n제 4 조 (심판 청구)\n\n본인과 배우자는 소송을 제기하고 재산을 분할하기 위해 심판을 청구합니다. 심판은 다음과 같이 청구합니다.\n\n1. 재산의 소유권 및 소유권의 분할\n2. 재산의 분할 방법\n3. 재산의 분할 기준\n4. 재산의 분할 결과\n5. 기타 필요한 사항', NULL, NULL, NULL, NULL, NULL, NULL),
	(174, '20230228', 'cmpl-6oapVLfs1jHubiqwgLzAih0eg9fIp', '서\n\n제출기관: 강원도 속초지방법원\n\n소송고지일: 2020년 8월 10일\n\n고소인: 김수연\n\n고소대상: 이승호\n\n모집번호: 2020-속초-0012\n\n감사합니다.\n\n본 소송은 김수연과 이승호가 가진 공동재산의 분할에 관한 것입니다. 김수연은 이승호에게 재산 분할을 요구하고 있습니다.\n\n김수연과 이승호는 자신들의 공동재산을 분할하기 위해 속초지방법원에 소송을 제기합니다. 김수연은 이승호가 공동재산을 분할하지 않고 자신의 재산만 사용하고 있다고 주장합니다.\n\n김수연은 이승호가 공동재산을 분할하지 않고 자신의 재산만 사용하고 있다고 주장합니다. 따라서, 김수연은 이승호가 공동재산을 분할하고 김수연에게 자신의 정당한 부분을 배분하도록 소송을 제기합니다.\n\n김수연은 이승호가 공동재산을 분할하고 김수연에게 자신의 정당한 부분을 배분하도록 소송을 제기합니다. 김수연은 이승호가 공동재산을 분할하고 김수연에게 자신의 정당한 부분을 배분하도록 소송을 제기합니다.\n\n따라서, 강원도 속초지방법원에 의해 김수연과 이승호의 공동재산 분할에 관한 소송이 제기됩니다. 김수연은 이승호가 공동재산을 분할하고 김수연에게 자신의 정당한 부분을 배분하도록 소송을 제기합니다.\n\n본 소송은 강원도 속초지방법원에 의해 심판되어야 합니다. 김수연은 이승호가 공동재산을 분할하고 김수연에게 자신의 정당한 부분을 배분하도록 소송을 제기합니다.\n\n따라서, 강원도 속초지방법원에 소송을 제기합니다. 김수연과 이승호는 공동재산의 분할에 관한 소송을 제기하고 있습니다. 본 소송은 강원도 속초지방법원에 의해 심판되어야 합니다.\n\n감사합니다.\n\nTo: Gangwon-do Sokcho District Court\n\nSubmission Date: August 10th, 2020\n\nPlaintiff: Kim Su-yeon\n\nDefendant: Lee Seung-ho\n\nCase Number: 2020-Sokcho-0012\n\nThank you.\n\nThis lawsuit is regarding the division of the joint property owned by Kim Su-yeon and Lee Seung-ho. Kim Su-yeon is demanding that Lee Seung-ho divide the property.\n\nKim Su-yeon and Lee Seung-ho are filing a lawsuit with the Gangwon-do Sokcho District Court in order to divide their joint property. Kim Su-yeon alleges that Lee Seung-ho is using only his own property and not dividing the joint property.\n\nKim Su-yeon alleges that Lee Seung-ho is using only his own property and not dividing the joint property. Therefore, Kim Su-yeon is filing a lawsuit to demand that Lee Seung-ho divide the joint property and distribute his rightful portion to Kim Su-yeon.\n\nTherefore, a lawsuit regarding the division of the joint property owned by Kim Su-yeon and Lee Seung-ho is being filed with the Gangwon-do Sokcho District Court. Kim Su-yeon is filing a lawsuit to demand that Lee Seung-ho divide the joint property and distribute his rightful portion to Kim Su-yeon.\n\nThis lawsuit must be adjudicated by the Gangwon-do Sokcho District Court. Kim Su-yeon is filing a lawsuit to demand that Lee Seung-ho divide the joint property and distribute his rightful portion to Kim Su-yeon.\n\nTherefore, a lawsuit is being filed with the Gangwon-do Sokcho District Court. Kim Su-yeon and Lee Seung-ho are filing a lawsuit regarding the division of the joint property. This lawsuit must be adjudicated by the Gangwon-do Sokcho District Court.\n\nThank you.', NULL, NULL, NULL, NULL, NULL, NULL),
	(175, '20230228', 'cmpl-6oipB9rD4DlC8ZpTiKLE4gBsF9Y8e', '1. 세종대왕비묘 관람\n2. 세종대왕비묘 근처 음식점 가보기\n3. 세종박물관 관람\n4. 세종대왕비묘 근처 수목원 가보기\n5. 세종대왕비묘 근처 카페 가보기\n6. 세종대왕비묘 근처 자연공원 가보기\n7. 세종대왕비묘 근처 쇼핑몰 가보기\n8. 세종대왕비묘 근처 연극관 가보기\n9. 세종대왕비묘 근처 영화관 가보기\n10. 세종대왕비묘 근처 연극관 가보기', NULL, NULL, NULL, NULL, NULL, NULL),
	(176, '20230301', 'cmpl-6ozBAUHWfrABzlMj5e0AZ1EQhl3SZ', '1. Take online courses: There are many online courses available to help you learn about big data. Look for courses that cover topics such as data analysis, data mining, machine learning, and data visualization.\n\n2. Read books: There are many books available on big data that can help you understand the concepts and technologies involved. Look for books that cover topics such as data analysis, data mining, machine learning, and data visualization.\n\n3. Attend conferences: Attending conferences and workshops can be a great way to learn about big data. Look for conferences that focus on topics such as data analysis, data mining, machine learning, and data visualization.\n\n4. Follow blogs: Following blogs and websites that focus on big data can help you stay up to date on the latest trends and technologies.\n\n5. Network: Networking with other professionals in the field can be a great way to learn about big data. Look for local meetups or online forums where you can connect with other professionals.\n\n1. 온라인 과정을 수강합니다: 빅 데이터에 대해 배우는 데 도움이 되는 많은 온라인 과정이 있습니다. 데이터 분석, 데이터 마이닝, 기계 학습 및 데이터 시각화와 같은 주제를 다루는 과정을 찾습니다.\n\n2. 책 읽기: 관련 개념과 기술을 이해하는 데 도움이 될 수 있는 빅 데이터 관련 서적이 많이 있습니다. 데이터 분석, 데이터 마이닝, 기계 학습 및 데이터 시각화와 같은 주제를 다루는 책을 찾아보십시오.\n\n3. 회의 참석: 컨퍼런스 및 워크샵에 참석하는 것은 빅 데이터에 대해 배우는 좋은 방법이 될 수 있습니다. 데이터 분석, 데이터 마이닝, 머신러닝, 데이터 시각화와 같은 주제에 초점을 맞춘 회의를 찾아보세요.\n\n4. 블로그를 팔로우하세요: 빅 데이터에 초점을 맞춘 블로그와 웹 사이트를 팔로우하면 최신 트렌드와 기술을 파악하는 데 도움이 될 수 있습니다.\n\n5. 네트워크: 해당 분야의 다른 전문가들과의 네트워킹은 빅 데이터에 대해 배우는 좋은 방법이 될 수 있다. 다른 전문가와 연결할 수 있는 로컬 미팅 또는 온라인 포럼을 찾습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
