	(178, '20230303', 'cmpl-6prV8fHYcG45y7OO9Tp9brwWPh1Mf', '요\n\n원신 디오는 모바일 게임으로, 스마트폰에서 플레이할 수 있는 롤플레잉 게임입니다. 게임의 주제는 신비한 원신들이 사람들의 삶을 구하기 위해 모험하는 것입니다. 게임의 주요 캐릭터는 사람들이 원신들을 불러내기 위해 사용하는 디오나라고 불리는 아이템입니다. 게임의 목표는 원신들을 불러내고, 이들을 이용해 사람들의 삶을 구하는 것입니다. 게임의 스토리는 사람들이 원신들을 불러내기 위해 디오나를 사용하는 것에서 시작합니다. 게임의 주요 기능은 원신들을 불러내고, 이들을 이용해 사람들의 삶을 구하는 것입니다. 또한, 게임의 스토리는 사람들이 원신들을 불러내기 위해 디오나를 사용하는 것에서 시작합니다. 게임의 주요 장르는 롤플레잉, 모험, 방탈출, 퍼즐 등이 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(179, '20230303', 'cmpl-6prW4GSq53xIrqcbHjgaa0HEwclNM', '라디오나의 착용 아이템으로는 방송 스튜디오에서 사용하는 마이크, 이어폰, 마이크 스탠드, 라이브 스트리밍 장비 등이 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
