	(182, '20230304', 'cmpl-6qFT7rWqPodqVJIwnHVP13THvKCQT', 'The Master of Business Administration (MBA) at the University of Western Australia (UWA) is a two-year, full-time program designed to equip students with the skills and knowledge to become successful business leaders. The program covers a range of topics, including accounting, finance, economics, marketing, strategy, and operations. Students will also gain an understanding of the legal and ethical aspects of business, as well as the ability to think critically and strategically. The program also includes a range of electives, allowing students to tailor their studies to their individual interests and career goals.', NULL, NULL, NULL, NULL, NULL, NULL),
	(183, '20230307', 'cmpl-6rGO97gfKfKuZs8yFIUPP2peQnjWV', '해외 시세 연계 방식의 용어는 “피씨업 연계”(Pairing Up)이라고 합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(184, '20230307', 'cmpl-6rGOmdtcAzQaokWmCkBOB7j7cXXCV', '거래소 코인 Book list를 연계하는 방식은 다음과 같습니다.\n\n1. API를 사용하여 거래소 코인 Book list를 연계하는 방법\n2. 블록체인 네트워크를 통해 거래소 코인 Book list를 연계하는 방법\n3. 데이터베이스를 통해 거래소 코인 Book list를 연계하는 방법\n4. 스크래핑을 통해 거래소 코인 Book list를 연계하는 방법', NULL, NULL, NULL, NULL, NULL, NULL),
	(185, '20230307', 'cmpl-6rGQMMKpNlTXtZCmrK5myXJ07FlVS', '거래소간 공유하는 방식으로 코인주문 내역을 공유하는 것은 API를 통해 가능합니다. API는 코인주문 내역을 거래소간 공유하기 위한 프로그램 인터페이스로, 거래소간 공유하는 방식으로 코인주문 내역을 공유하기 위해서는 각 거래소가 제공하는 API를 사용해야 합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(186, '20230308', 'cmpl-6rg6NLiGbJ2XRfD5EkQ4svAU0L8F3', 'import asyncio\n\nasync def main():\n    print(\'Hello\')\n    await asyncio.sleep(1)\n    print(\'World\')\n\nasyncio.run(main())', NULL, NULL, NULL, NULL, NULL, NULL),
	(187, '20230308', 'cmpl-6rg7I96KXOGuvLdvu7d5Gzn3IOOqy', '세롬이는 상당히 열심히 공부하고 연습하여 탁구 실력을 매우 뛰어나게 만들었습니다. 또한 여러 사람들에게 탁구 연습법을 잘 알려주고 있습니다. 세롬이는 정말 멋진 탁구 멘토입니다!', NULL, NULL, NULL, NULL, NULL, NULL),
	(188, '20230308', 'cmpl-6rg7xfm7wj8pkoHU8nZnuIOrfIZpr', '새롬이는 상당히 열심히 공부하고 연습하여 탁구 실력을 매우 빠르게 향상시켰습니다. 또한 새롬이는 스스로 연습하는 것뿐만 아니라 다른 사람들과 함께 경쟁하는 것도 좋아하며, 승리를 거두기 위해 노력합니다. 새롬이는 열정과 열망을 가지고 탁구를 연구하고 연습하는 것을 즐깁니다. 따라서 새롬이는 열정과 노력으로 탁구 실력을 높이고 있습니다. 따라서 새롬이에게 강한 칭찬을 해주어야 합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(189, '20230309', 'cmpl-6rzRQmuLwT8sdGdWbVx0bU9oZgy0B', '삼국지는 중국의 유명한 역사소설로, 유럽 중세의 역사와 비슷한 시기에 일어난 중국의 역사를 다룬 소설이다. 이 소설은 삼국 시대를 배경으로 하여 주인공들의 인간관계와 전쟁을 그린다. 이 소설은 중국 역사상 가장 중요한 이벤트들을 다루고 있으며, 중국 역사상 중요한 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 삼국지는 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있는 중국의 유명한 역사소설로, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다.\n\n삼국지는 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있는 중국의 유명한 역사소설로, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 삼국 시대를 배경으로 하여 주인공들의 인간관계와 전쟁을 그리며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 삼국지는 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있는 중국의 유명한 역사소설로, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다.\n\n삼국지는 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있는 중국의 유명한 역사소설로, 삼국 시대를 배경으로 하여 주인공들의 인간관계와 전쟁을 그리며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다.\n\n삼국지는 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있는 중국의 유명한 역사소설로, 삼국 시대를 배경으로 하여 주인공들의 인간관계와 전쟁을 그리며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있으며, 중국 역사상 중요한 이벤트들과 인물들의 이야기를 다루고 있다. 이 소설은 중국 역사상 중요한 이벤트들', NULL, NULL, NULL, NULL, NULL, NULL),
	(190, '20230309', 'cmpl-6s0deFND21YFcTeWMmhTsG0EEeedn', '구글 원의 가격은 시장 상황에 따라 변동하기 때문에 정확한 가격을 알 수 없습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(191, '20230309', 'cmpl-6sAWtvp8Eqqa0pFPYjavcZmNTjytq', '1. 아이엘츠를 이해하기 위해서는 기본 용어부터 이해해야 합니다. 아이엘츠의 기본 용어는 다음과 같습니다.\n\n- 아이엘츠(Illust): 일러스트레이션이라는 단어는 일러스트레이터가 그린 일러스트레이션을 의미합니다.\n\n- 디자인(Design): 디자인은 일러스트레이션을 사용하여 상품이나 서비스를 만들기 위한 과정을 의미합니다.\n\n- 소프트웨어(Software): 소프트웨어는 일러스트레이션을 생성하고 관리하기 위해 사용되는 프로그램을 의미합니다.\n\n2. 아이엘츠를 체계적으로 공부하기 위해서는 일러스트레이션 기법과 디자인 원리를 이해해야 합니다. 일러스트레이션 기법은 색상, 라인, 그림자, 글자 등의 요소를 사용하여 일러스트레이션을 만드는 방법을 의미합니다. 디자인 원리는 일러스트레이션을 사용하여 디자인을 만드는 방법을 의미합니다.\n\n3. 아이엘츠를 체계적으로 공부하기 위해서는 소프트웨어를 사용해야 합니다. 일러스트레이션을 만들기 위해 사용할 수 있는 소프트웨어는 다양합니다. 일반적으로 사용하는 소프트웨어는 Adobe Illustrator, Corel Draw, Inkscape 등이 있습니다.\n\n4. 아이엘츠를 체계적으로 공부하기 위해서는 일러스트레이션과 디자인 작업을 연습해야 합니다. 일러스트레이션과 디자인 작업을 연습하기 위해서는 일러스트레이션 기법과 디자인 원리를 이해하고 소프트웨어를 사용해야 합니다. 연습을 통해 일러스트레이션과 디자인 작업을 배울 수 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(192, '20230309', 'cmpl-6sAYFguEpdEgJzDQSsUALzySyO4ZU', '1. 일정 관리하기\nIELTS 시험 공부를 체계적으로 하기 위해서는 먼저 일정을 관리하는 것이 중요합니다. 시험 날짜가 얼마 남지 않았다면, 남은 시간을 최대한 효율적으로 공부하기 위해 일정을 잘 관리해야 합니다.\n\n2. 공부 내용 정리하기\nIELTS 시험 공부를 체계적으로 하기 위해서는 공부한 내용을 정리하는 것이 중요합니다. 공부한 내용을 정리하면 시험 날에 복습하기가 쉬워집니다.\n\n3. 문제 풀기\nIELTS 시험 공부를 체계적으로 하기 위해서는 문제를 풀어보는 것이 중요합니다. 문제를 풀면서 자신의 실력을 확인할 수 있으며, 실수한 부분을 바로 수정할 수 있습니다.\n\n4. 복습하기\nIELTS 시험 공부를 체계적으로 하기 위해서는 복습하는 것이 중요합니다. 복습하면서 자신이 공부한 내용을 잊지 않고 기억할 수 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(193, '20230309', 'cmpl-6sAckkfIpdiwEiqOXpJEzYV1qDZHW', '1. Abide by (따르다)\n2. Abound in (넘치다)\n3. Abrogate (취소하다)\n4. Abscond (도망가다)\n5. Abstemious (절제된)\n6. Abstruse (난해한)\n7. Abysmal (끔찍한)\n8. Accede (이의를 허가하다)\n9. Accentuate (강조하다)\n10. Acclaim (칭찬하다)\n11. Accolade (칭찬)\n12. Accommodate (수용하다)\n13. Accost (말하다)\n14. Accrue (쌓이다)\n15. Accumulate (모이다)\n16. Accurate (정확한)\n17. Achromatic (무색의)\n18. Acme (최고점)\n19. Acrimonious (성난)\n20. Acumen (명료함)\n21. Adamant (굳은)\n22. Adept (숙달한)\n23. Adhere (따르다)\n24. Adjacent (인접한)\n25. Adjudicate (판결하다)\n26. Admonish (경고하다)\n27. Adorn (장식하다)\n28. Adroit (솜씨 좋은)\n29. Adulterate (위조하다)\n30. Adverse (반대의)\n31. Advocate (주장하다)\n32. Aesthetic (예술적인)\n33. Affable (친절한)\n34. Affinity (관계)\n35. Aggregate (합계)\n36. Agile (민첩한)\n37. Agitate (흔들다)\n38. Alacrity (기꺼이)\n39. Alleviate (경감하다)\n40. Allocate (할당하다)\n41. Allude (암시하다)\n42. Allure (매료하다)\n43. Aloof (고동한)\n44. Altruism (이타주의)\n45. Amalgamate (통합하다)\n46. Amass (모이다)\n47. Ambiguous (모호한)\n48. Ameliorate (개선하다)\n49. Amenable (의지하는)\n50. Amicable (친절한)', NULL, NULL, NULL, NULL, NULL, NULL),
	(194, '20230309', 'cmpl-6sAfZkpcDX0jpYzYMOipSRMKwQU0O', '1. Abide by (따르다) - To accept and follow a decision or rule. Ex) We must abide by the law.\n\n2. Abound in (넘치다) - To be full of something. Ex) The forest abounds in wildlife.\n\n3. Abrogate (취소하다) - To officially cancel or end a law, agreement, or custom. Ex) The government abrogated the treaty.\n\n4. Abscond (도망가다) - To leave quickly and secretly, usually to avoid capture or arrest. Ex) The criminal absconded with the money.\n\n5. Abstemious (절제된) - Not indulging in too much food, drink, or luxury. Ex) He was abstemious in his eating habits.\n\n6. Abstruse (복잡한) - Difficult to understand; obscure. Ex) The professor\'s lecture was too abstruse for the students.\n\n7. Accede (동의하다) - To agree to a demand, request, or treaty. Ex) The president acceded to the demands of the protesters.\n\n8. Acclivity (경사) - An upward slope or incline. Ex) The road had a steep acclivity.\n\n9. Accolade (칭찬) - Praise or approval. Ex) She received accolades for her work.\n\n10. Accost (걸려가다) - To approach and speak to someone boldly or aggressively. Ex) He was accosted by a stranger on the street.', NULL, NULL, NULL, NULL, NULL, NULL),
	(195, '20230311', 'cmpl-6sfq4AEb259ITo2ya3xVQuhovoMHj', '안녕하세요!', NULL, NULL, NULL, NULL, NULL, NULL),
	(196, '20230311', 'cmpl-6shdeBsDr1KKsBk1pVOA8xBc6n1YO', '같아야 합니다.\n\n```\nclass Person {\n  constructor(name, age) {\n    this.name = name;\n    this.age = age;\n  }\n  getName() {\n    return this.name;\n  }\n  getAge() {\n    return this.age;\n  }\n  setName(name) {\n    this.name = name;\n  }\n  setAge(age) {\n    this.age = age;\n  }\n}\n```', NULL, NULL, NULL, NULL, NULL, NULL),
	(197, '20230311', 'cmpl-6shdy0N45obGzqhJyjDYqGktnqMcc', '?\n\n나이는 25세입니다.', NULL, NULL, NULL, NULL, NULL, NULL),
