	(199, '20230311', 'cmpl-6shf0bLFP1xVVyqRh9xSC0OBeW2GS', '무엇인가\n\n사랑은 상대방을 존중하고 이해하며, 그리고 상대방의 기분과 생각을 배려하며 상대방의 장점을 인정하고 상대방의 니즈를 이해하는 감정적인 관계를 말합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
