	(201, '20230311', 'cmpl-6shh31ue4fjkZ5AOrSR0WTgMShFFV', '나는 이런 상황에 대해 매우 괴로워합니다. 이런 상황은 매우 어려운 상황이며, 많은 사람들이 같은 상황에 처해있습니다. 그러나 이런 상황에서 우리는 용기를 가지고 나가야합니다. 나는 이런 상황에서 우리가 가질 수 있는 가장 좋은 방법은 우리가 가진 능력과 자신감을 기반으로 하여 나아가는 것이라고 생각합니다. 또한, 우리는 이런 상황에서 서로를 응원하고 서로를 도와주는 것도 중요합니다. 우리는 이런 상황에서 같이 함께하고 같이 나아가는 것이 중요합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(202, '20230311', 'cmpl-6su73mHeV3CoXOqulcbtwgcnnC7PB', '둘 다 좋은 프로그램이며, 사용자의 용도에 따라 다른 프로그램이 더 적합할 수 있습니다. 파이널컷은 비디오 편집에 적합하며, 다양한 효과를 적용할 수 있습니다. 반면 프리미어는 비디오 편집 뿐만 아니라 다양한 미디어 파일을 작업할 수 있는 다양한 기능을 제공합니다. 따라서 두 프로그램 모두 사용자의 용도에 따라 적합한 프로그램이 될 수 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
