	(228, '20230316', 'cmpl-6udze25eLyqPz45O4uQGN0l6moiqA', '대부분의 경우, 횟수제한이 있습니다. 예를 들어, 일부 쿠폰은 한 사람당 한 번만 사용할 수 있고, 일부 상품은 한 번에 한 개만 구매할 수 있습니다. 또한, 일부 상품은 한 달에 한 번만 구매할 수 있습니다. 각 상품마다 횟수제한이 다르기 때문에, 상품 상세 정보를 확인하여 확인해야 합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
