	(237, '20230319', 'cmpl-6vjkN39UPpvVECv4nZ0AwO5H04N5i', '요?\n\n대한민국의 현재 대통령은 문재인입니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(238, '20230319', 'cmpl-6vjoR1HehaR6BAJWZDZWaAZ4e0xm9', '1. Plant cover crops: Planting cover crops is a great way to maintain organic matter in soil. Cover crops are plants that are grown to protect the soil from erosion, add nutrients, and improve soil structure.\n\n2. Compost: Composting is a great way to add organic matter to soil. Composting involves breaking down organic materials such as leaves, grass clippings, and food scraps into a nutrient-rich soil amendment.\n\n3. Mulch: Mulching is another great way to maintain organic matter in soil. Mulch is a layer of organic material such as wood chips, straw, or leaves that is spread over the soil to help retain moisture and prevent weeds from growing.\n\n1. 식물 피복 작물: 피복 작물을 심는 것은 토양의 유기물을 유지하는 좋은 방법이다. 피복작물은 토양을 침식으로부터 보호하고, 영양분을 첨가하고, 토양 구조를 개선하기 위해 재배되는 식물이다.\n\n2. 퇴비: 퇴비화는 토양에 유기물을 첨가하는 좋은 방법이다. 퇴비화는 나뭇잎, 풀 조각, 음식 찌꺼기와 같은 유기 물질을 영양소가 풍부한 토양 수정으로 분해하는 것을 포함한다.\n\n3. 멀치: 멀치는 토양의 유기물을 유지하는 또 다른 훌륭한 방법입니다. 멀치(Mulch)는 나무 조각, 짚 또는 잎과 같은 유기 물질의 층으로, 수분을 유지하고 잡초가 자라는 것을 방지하기 위해 흙 위에 퍼진다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(239, '20230319', 'cmpl-6vjol23IpgVoaYsWTBboibRR84HnX', '1. 잔디밭을 관리하기: 잔디밭을 잘 관리하면 잔디밭에서 생기는 유기물을 줄일 수 있습니다. 잔디밭을 잘 관리하기 위해서는 잔디밭을 자주 자르고, 잔디밭에 나무나 덤불 등의 식물을 심어주는 것이 좋습니다.\n\n2. 쓰레기를 제대로 버리기: 쓰레기를 제대로 버리는 것이 중요합니다. 쓰레기는 적절한 쓰레기통에 버리고, 재활용할 수 있는 쓰레기는 재활용하는 것이 좋습니다.\n\n3. 자연과 친해지기: 자연과 친해지는 것이 중요합니다. 자연을 즐기고, 자연을 존중하는 것이 중요합니다. 자연을 즐기면서 자연을 소중히 여기는 것이 중요합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(240, '20230319', 'cmpl-6vjpXyFsyQxCESQU10BigFBTmUeIO', '1. Plant cover crops: Planting cover crops is a great way to maintain organic matter in soil. Cover crops are plants that are grown to protect the soil from erosion, add nutrients, and improve soil structure.\n\n2. Compost: Composting is a great way to add organic matter to soil. Composting involves breaking down organic materials such as leaves, grass clippings, and food scraps into a nutrient-rich soil amendment.\n\n3. Mulch: Mulching is another great way to maintain organic matter in soil. Mulch is a layer of organic material such as wood chips, straw, or leaves that is spread over the soil to help retain moisture and prevent weeds from growing.\n\n1. 식물 피복 작물: 피복 작물을 심는 것은 토양의 유기물을 유지하는 좋은 방법이다. 피복작물은 토양을 침식으로부터 보호하고, 영양분을 첨가하고, 토양 구조를 개선하기 위해 재배되는 식물이다.\n\n2. 퇴비: 퇴비화는 토양에 유기물을 첨가하는 좋은 방법이다. 퇴비화는 나뭇잎, 풀 조각, 음식 찌꺼기와 같은 유기 물질을 영양소가 풍부한 토양 수정으로 분해하는 것을 포함한다.\n\n3. 멀치: 멀치는 토양의 유기물을 유지하는 또 다른 훌륭한 방법입니다. 멀치(Mulch)는 나무 조각, 짚 또는 잎과 같은 유기 물질의 층으로, 수분을 유지하고 잡초가 자라는 것을 방지하기 위해 흙 위에 퍼진다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(241, '20230321', 'cmpl-6wJZ3jEssWyO3CLSBZszl3ylhmbsA', '1. 개발 환경 설정\n- Microsoft Visual Studio\n- Microsoft Office Developer Tools\n\n2. 엑셀 Add-in 개발\n- 엑셀 Add-in 프로젝트 생성\n- 엑셀 Add-in 기능 구현\n- 엑셀 Add-in 배포\n- 엑셀 Add-in 설치 및 사용', NULL, NULL, NULL, NULL, NULL, NULL),
