	(254, '20230326', 'cmpl-6yK0DKa5m0F3LWhD4t0ICtBPO3cAD', '- 네이버 카페\n- 다음 카페\n- 네이트 카페\n- 스팸디비\n- 스팸맨\n- 스팸방지\n- 스팸차단\n- 스팸필터\n- 메일필터\n- 메일방지\n- 메일차단\n- 메일필터링\n- 메일매니저\n- 메일매니져', NULL, NULL, NULL, NULL, NULL, NULL),
	(255, '20230326', 'cmpl-6yK0VJID7XZqNDpfj9VIJJ74ELbVo', '1. 브라질\n2. 스페인\n3. 독일\n4. 아르헨티나\n5. 영국\n6. 프랑스\n7. 이탈리아\n8. 콜롬비아\n9. 대한민국\n10. 우루과이', NULL, NULL, NULL, NULL, NULL, NULL),
	(256, '20230327', 'cmpl-6yZwq0KDw4IjDCHRg2V3giZRipb6D', '아우구스티누스는 독일의 자연학자이자 철학자이다. 그는 17세기 중반에 살며, 자연과학의 역사에서 가장 중요한 인물 중 하나로 여겨진다. 그는 자연과학의 역사에서 중요한 역할을 하였으며, 이론과 실험을 통해 자연의 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 에너지의 유지를 증명하고, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다.\n\n아우구스티누스는 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했으며, 에너지의 유지를 증명하고, 에너지의 상태를 변화시키는 법칙을 찾아내는 데 엄청난 공헌을 했다. 그는 또한 에너지의 상태를 변화시키는 법', NULL, NULL, NULL, NULL, NULL, NULL),
	(257, '20230329', 'cmpl-6zEDcPotMjovv3cto4EajXdyHnbYs', '오늘의 날씨는 맑고 따뜻합니다. 강수확률은 낮고, 기온은 오늘 오후에는 약 20도까지 올라갈 전망입니다. 따뜻한 하루 보내세요!', NULL, NULL, NULL, NULL, NULL, NULL),
	(258, '20230329', 'cmpl-6zI3DpW4dC4Zys8tGTfsNwzcrM2me', '면, 이는 다양한 요인에 의해 발생할 수 있습니다. 가장 흔한 이유는 꿀벌이 사는 곳이 변하거나 소멸되어 꿀벌이 생활할 수 있는 환경이 없어지기 때문입니다. 또한, 꿀벌이 사는 곳이 오염되거나 기후 변화로 인해 꿀벌이 사는 곳이 더욱 더 열려있게 되면 꿀벌이 사는 곳이 더욱 더 위험해질 수 있습니다. 또한, 꿀벌이 사는 곳에서 사는 동물들이 꿀벌을 사냥하거나 꿀벌이 사는 곳에서 사는 감염병이 발생하면 꿀벌이 사라질 수도 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(259, '20230329', 'cmpl-6zJyKLVy3ukraaFBTU08MRFnQoGoU', '1. 제임스 바우만 (James Brown)\n\n2. 빅토르 바흐 (Johann Sebastian Bach)\n\n3. 모차르트 (Wolfgang Amadeus Mozart)\n\n4. 베토벤 (Ludwig van Beethoven)\n\n5. 클라라 스코틀랜드 (Clara Schumann)\n\n6. 프랑수아 슈베르트 (Franz Schubert)\n\n7. 조지 버클리 (George Frideric Handel)\n\n8. 알렉산더 드비스 (Alexander Scriabin)\n\n9. 알렉산더 레빈 (Alexander Levin)\n\n10. 알렉산더 브라핌 (Alexander Brailowsky)', NULL, NULL, NULL, NULL, NULL, NULL),
	(260, '20230329', 'cmpl-6zMkeRfyUQbWS5YIV8pDbj2EVvtIn', '부산은행 박일용은 한국의 은행 직원으로, 부산은행의 전무이다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(261, '20230330', 'cmpl-6zfJwd4rpKLBnj1RGcFqQWQGceYPx', '광주시청 주차장은 시내 주차장으로 주차요금이 적용됩니다. \n\n주차요금은 주차시간에 따라 다음과 같이 적용됩니다. \n\n- 주차시간이 30분 미만일 경우 : 무료 \n- 주차시간이 30분 이상 1시간 미만일 경우 : 500원 \n- 주차시간이 1시간 이상 2시간 미만일 경우 : 1,000원 \n- 주차시간이 2시간 이상 3시간 미만일 경우 : 1,500원 \n- 주차시간이 3시간 이상 4시간 미만일 경우 : 2,000원 \n- 주차시간이 4시간 이상 5시간 미만일 경우 : 2,500원 \n- 주차시간이 5시간 이상 6시간 미만일 경우 : 3,000원 \n- 주차시간이 6시간 이상 24시간 미만일 경우 : 4,000원 \n- 주차시간이 24시간 이상일 경우 : 일일 최고 4,000원', NULL, NULL, NULL, NULL, NULL, NULL),
	(262, '20230403', 'cmpl-71Db4LCR9rMnyxAyeeBOrDzA9SwUb', '요?\n\n1. 국어 공부는 기본적으로 단어 외우기, 문법 공부, 읽기 등이 필요합니다. \n\n2. 단어 외우기는 새로운 단어를 외우기 위해 단어장을 작성하거나, 단어 암기 카드를 만들어 외우는 것이 좋습니다.\n\n3. 문법 공부는 문법 책을 참고하거나, 문법 연습 문제를 풀어보는 것이 좋습니다.\n\n4. 읽기는 자신이 좋아하는 장르의 책을 읽거나, 신문과 잡지를 읽는 것이 좋습니다.\n\n5. 또한, 국어 공부를 할 때는 이미 알고 있는 내용을 자주 복습하는 것도 중요합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(263, '20230403', 'cmpl-71DcE887oswVlI4GISDdl5X9e7X3a', '지구 멸망의 시기는 정확히 예측하기 어렵습니다. 하지만 지구 멸망을 초래할 수 있는 여러 요인들이 있습니다. 이러한 요인들은 지구 온난화, 지구 기상 변화, 지구 자원 부족 등이 있습니다. 이러한 요인들이 지구 멸망을 초래할 수 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(264, '20230403', 'cmpl-71DcwY5Z8C3l4dxhtRyvlT3c6OgZI', '김상민 기자는 한국 경제신문 경향신문의 기자로 재무부문을 담당하고 있다. 김상민 기자는 전문적인 기술과 깊이 있는 인사이트를 가지고 있으며, 금융 분야의 주요 이슈를 다루고 있다. 김상민 기자는 연구 및 분석을 통해 금융 시장의 동향과 정책 방향을 분석하고 있으며, 금융 시장의 변화에 대한 분석과 예측을 제공하고 있다. 또한 김상민 기자는 금융 시장의 변화에 따른 기업의 전략 및 정책 변경에 대한 분석과 예측을 제공하고 있다.', NULL, NULL, NULL, NULL, NULL, NULL),
