	(280, '20230414', 'cmpl-7526ohJgmSihhpEXST3ljBPZLLsJd', '보안 코드를 필요로하는 것 같습니다. 스팀 가드 코드는 다음과 같습니다:', NULL, NULL, NULL, NULL, NULL, NULL),
	(281, '20230414', 'cmpl-75271snjnUsvZpgSkRESjziUxcQYL', '당신이 새로운 장치에서 로그인을 시도하고 있는 것 같습니다. 여기에 계정에 접근하기 위해 필요한 Steam Guard 코드가 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(282, '20230415', 'cmpl-75NhjlrkeOBKFG08DS4rdIkXWzYPH', '야 합니다.\n\nfrom selenium import webdriver\n\n# 드라이버 생성\ndriver = webdriver.Chrome(\'C:/chromedriver.exe\')\n\n# 엔우리 사이트 접속\ndriver.get(\'https://www.enuri.com/\')\n\n# 로그인 버튼 클릭\ndriver.find_element_by_xpath(\'//*[@id="header"]/div[2]/div[2]/div[2]/div[2]/a\').click()\n\n# 아이디 입력\ndriver.find_element_by_xpath(\'//*[@id="login_id"]\').send_keys(\'아이디\')\n\n# 비밀번호 입력\ndriver.find_element_by_xpath(\'//*[@id="login_pwd"]\').send_keys(\'비밀번호\')\n\n# 로그인 버튼 클릭\ndriver.find_element_by_xpath(\'//*[@id="login_btn"]\').click()', NULL, NULL, NULL, NULL, NULL, NULL),
