	(288, '20230419', 'cmpl-76ya5sRbouITYkph5Oc1sK2YQJog8', '부산은행 디지털바우처는 고객들에게 편리하고 안전한 결제 방법을 제공하는 것으로 보입니다. 디지털바우처는 신용카드, 계좌이체, 모바일 결제 등 다양한 결제 방법을 제공하고 있습니다. 또한 디지털바우처는 사용자가 손쉽게 사용할 수 있도록 사용자 친화적인 인터페이스를 제공하고 있습니다. 따라서 부산은행 디지털바우처는 고객들에게 편리하고 안전한 결제 방법을 제공하는 것으로 생각합니다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(289, '20230421', 'cmpl-77dJ0lyGupKUL9CN0SwvzHeSSQJ9T', '대한민국은 아시아 동부에 위치한 남한이라고 불리는 동아시아 국가이다. 대한민국은 1948년 8월 15일 대한민국 공화국이 선포되었고, 그 이후 민주주의 정치 체제를 실시하고 있다. 대한민국은 세계에서 가장 발전한 국가 중 하나로 여겨지며, 정치, 경제, 문화 등 다양한 분야에서 세계 수준의 성과를 보여주고 있다.', NULL, NULL, NULL, NULL, NULL, NULL),
	(290, '20230426', 'cmpl-79RLfOejoS8032gV13umrYvw2nRYR', '지구의 종말은 정확하게 예측할 수 없습니다. 가장 가능성이 높은 사건으로는 태양의 활동이 줄어들어 태양이 소멸하거나, 태양계의 다른 별들이 지구를 파괴하는 것이 있습니다. 또한, 지구가 멀리 떨어진 곳에 있는 다른 별들의 중력에 의해 이동하거나, 다른 우주 물질들과 충돌하는 것도 지구의 종말이 될 수 있습니다.', NULL, NULL, NULL, NULL, NULL, NULL),
