	(293, '20230428', 'cmpl-7AJ5oVEidzCGaSKFrTNCuyegXDKT9', 'High frequency trading bots are computer programs that use algorithms to rapidly buy and sell stocks, futures, or other financial instruments. These bots are designed to take advantage of small price movements in the market and can execute trades in milliseconds. They are often used by large institutional investors and hedge funds to make quick profits.\n\nThe use of high frequency trading bots on MEXC is not something that is widely known, but it is possible. It is likely that these bots are being used by large institutional investors or hedge funds to take advantage of small price movements in the market. It is important to note that these bots can be risky and can lead to large losses if not used properly. Therefore, it is important to do your own research and understand the risks before using these bots.', NULL, NULL, NULL, NULL, NULL, NULL),
	(294, '20230428', 'cmpl-7AJ5pNGCfedEzw6MNqW1U4cHeqayA', 'High frequency trading bots are becoming increasingly popular in the cryptocurrency space. These bots are designed to take advantage of small price movements in the market by executing trades at a very high frequency. They are typically used by traders who are looking to make a quick profit from small price movements.\n\nThe MEXC exchange is no exception to this trend. It is likely that there are traders running high frequency trading bots on the MEXC exchange within the 29350-29200 range. These bots are likely to be executing large volume orders in order to take advantage of the small price movements.\n\nIt is important to note that high frequency trading bots can be risky and should only be used by experienced traders. It is also important to note that these bots can be easily manipulated by market makers and other traders, so it is important to be aware of the risks associated with using them.', NULL, NULL, NULL, NULL, NULL, NULL),
