	(296, '20230625', 'cmpl-7V897brVrs4DndgsrqPGPLcVxLjYr', '합니다.\n\n먼저 다음과 같은 방법으로 변수를 선언합니다.\n\n```\nint num1;\nint num2;\n```\n\n그런 다음 두 수를 입력 받습니다.\n\n```\nprintf("Enter two numbers: ");\nscanf("%d %d", &num1, &num2);\n```\n\n그런 다음 두 수를 비교하고 결과를 출력합니다.\n\n```\nif (num1 > num2)\n    printf("%d is greater than %d\\n", num1, num2);\nelse if (num1 < num2)\n    printf("%d is less than %d\\n", num1, num2);\nelse\n    printf("%d is equal to %d\\n", num1, num2);\n```', NULL, NULL, NULL, NULL, NULL, NULL),
